    false,nt"url": null,nt"notes": "This report summarizes a study of small
    mammals and their habitats at Des Lacs National Wildlife Refuge, completed by a
    University of Wisconsin intern.  Objectives of this work were to: (1) document species
    composition of the small mammal community in Drift Plain grasslands on Des Lacs
    NWR; (2) compare small mammal abundance and vegetation composition and structure
    among areas managed with prescribed fire, livestock grazing, and long-term rest;
